import React from 'react';

export default function UserDetail( { id, name, gender, email, birthdate, age, image, city} ) {
    
  return (
    <div className='user'>
       <h2>{id}</h2>
      <h2>{name}</h2>
      <h3> Age:{age} </h3>
      <h3> email:{email}</h3>
      <h3>birthdate:{birthdate}</h3>
      <h4>Gender: {gender}</h4>
      <img src={image}/>
      <h3>{city}</h3>
    </div>
  );
}
